 def quadratic_solver(a, b, c, d):
    # Check if the equation is actually a quadratic (c^2 > 4*ac)
    if abs(c**2 - 4*a*d) < EPSILON:
        return [(-b + sqrt(b**2 - 4*a*c)) / (2*a), (-b - sqrt(b**2 - 4*a*c)) / (2*a)]
    else:
        return []

# Example usage with a given equation
equation = "ax^3 + bx^2 + cx + d = 0"
print("Given equation:", equation)

# Get the coefficients of the equation
a, b, c, d = map(float, input("Enter the values for a, b, c, and d: ").split())

solutions = quadratic_solver(a, b, c, d)
if solutions:
    print("Solutions:", solutions)
else:
    print("No real solutions")
